import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import "./App.css";
// components
import Index from "./components/index";
import Loginclient from "./components/login/loginclient";
function App() {
  return (
    <Provider store={store}>
      <div>
        <Router>
          <Switch>
            <Route exact path="/">
              <Loginclient />
            </Route>
          </Switch>
        </Router>
      </div>
    </Provider>
  );
}

export default App;
